import React, { useState } from 'react';
import { motion } from 'framer-motion';
import '../styles/About.scss';

function About() {
    return (
        <div id='About'>
            <img id='me' src='../img/me.png' alt='Photo of Jiyun Yu' />
            <div className='about-container'>
               <h1>Hi, my name is Jiyun Yu.</h1>
               <h3>I'm a front-end developer in Seattle, Washington <br/> focused on web/mobile design</h3>
            </div>
        </div>
    );
}

export default About;
